import React, { Component } from "react";
import Home from "./Home";
import Stuff from "./Stuff";
import Contact from "./Contact";
import LoginComponent from "./components/LoginComponent";
import CreateDonor from "./components/CreateDonor";
import Donor from "./components/Donor";
import Search from "./components/Search";
import StockHome from "./components/StockHome";
import logout from "./components/logout";
import allDonor from "./components/allDonor";
import UpdateDonor from "./components/UpdateDonor";
import DeleteDonor from "./components/DeleteDonor";

import {
  Route,
  HashRouter
} from "react-router-dom";
import "./index.css";

 
class Main extends Component {
  render() {
    return (
      <HashRouter>
        <div>
          <h2>ONLINE BLOOD DONATION MANAGEMENT SYSTEM</h2>
            <div className="content">
                    <Route exact path="/" component={Home}/>
                    <Route path="/stuff" component={Stuff}/>
                    <Route path="/contact" component={Contact}/>
                    <Route path="/Login" component={LoginComponent}/>
                    <Route path="/adddonor" component={CreateDonor}/>
                    <Route path="/Donor" component={Donor}/>
                    <Route path="/search" component={Search}/>
                    <Route path="/Stock" component={StockHome}/>
                    <Route path="/exit" component={logout}/>
                    <Route path="/allDonor" component={allDonor}/>
                    <Route path="/updateDonor" component={UpdateDonor}/>
                    <Route path="/DeleteDonor" component={DeleteDonor}/>
            </div>
        </div>
      </HashRouter>
    );
  }
}
 
export default Main;
